/* eslint-disable */

// 旭日图生成器
export default function sunburstOption(config, fileDataMap, xData, yDataArr, selectedChartType, seriesData, customOption = {}) {
    console.log('[sunburstOption] config:', config);
    console.log('[sunburstOption] fileDataMap:', fileDataMap);
    console.log('[sunburstOption] xData:', xData);
    console.log('[sunburstOption] yDataArr:', yDataArr);
    console.log('[sunburstOption] selectedChartType:', selectedChartType);
    console.log('[sunburstOption] seriesData:', seriesData);
    console.log('[sunburstOption] customOption:', customOption);

    return {
        series: {
            type: 'sunburst',
            data: seriesData,
            radius: [0, '90%'],
            label: { rotate: 'radial' }
        }
    };
}
